import React from 'react';
import Link from 'next/link'

const Profile = () => {
    return (
    <>
        <div>프로필</div>
        <Link href="/"><Button>홈</Button></Link>
        <Link href="/signup"><Button>회원가입</Button></Link>
    </>)
}

export default Profile ;
